import React, { Component } from 'react';



class Page3 extends Component {
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                <h1 id="p3title" className="bold center">Plan for the day</h1>
                <div id="page3" className='left container_for_medium_margin'>
                    <ol>
                        <li className="li">Icebreaker game</li>
                        <li className="li">Check in about your coping strategies</li> 
                        <li className="li">Watch a video about getting support</li>
                        <li className="li">Brainstorm the people you can go to for support</li>
                        <li className="li">Work on your coping strategy toolkit</li>
                        <li className="li">Time for questions</li>
                        <li className="li">Reminders about mentoring</li>
                        <li className="li">Make a plan for practice</li>
                    </ol>
                </div>
            </div>
        )
    }
}
export default Page3;
